import Link from 'next/link';
import styled from 'styled-components';
import Nav from './Nav';

const Logo = styled.h1`
  background: red;
`;

const Header = () => (
  <header>
    <div className="bar">

    </div>
    <div className="sub-bar">
      <p>Search</p>
    </div>
    <Nav />
  </header>
);

export default Header;
